How can I use latest MongoDB C# Driver to delete an element within a nested array of complex array objects based on multiple conditions?<p>The overall goal is to be able to perform a lookup of a meal based on the userid, and mealid. If that item is found, I want to be able to delete only the entire element that matches both the userid and mealid.</p>

<p>Currently, After sending the request object via postman in a post request, I have tried to write a variation of queries using the C# to create a builder object, and then filter to find the specific array object, and finally delete the array object if there is a match on both <strong>userid and mealid</strong>.  Initially, I was getting the issue where the entire element was not being deleted, but only the interal array element that is nested inside of the element was being (not deleted, but set back to null values). However, now the issue is that the entire array element is not being deleted at all and  i'm getting the following error.
<a href="https://i.stack.imgur.com/ZJjAF.png" rel="nofollow noreferrer">BsonArraySerializer Error from Visual Studio</a></p>

<p>Can someone please help me to resolve this issue?</p>

<p>Here is a sample object that I'm sending via postman that I'm trying to delete:
<a href="https://i.stack.imgur.com/b09Dp.png" rel="nofollow noreferrer">Sample Postman POST request with Body data</a></p>

<p>Here is an example image of data that I'm trying to delete:
<a href="https://i.stack.imgur.com/qnTLk.png" rel="nofollow noreferrer">Sample Image of Json Array Elemet I'm trying to delete</a></p>

<p><strong><em>You will need MongoDb Compass or Atlas, .NET Core 3.1, MongoDB C# Driver 2.0, Postman, and .NET Core 3.1 WebApi Project/Solution in order to help solve this issue.</em></strong></p>

<p>Below, is the code that is needed to replicate the issue:</p>

<p><strong>Startup.cs</strong></p>

<p>Add this line of code to the Configuration method of this file</p>

<pre class="lang-cs prettyprint-override"><code>services.AddScoped&lt;IMealsRepository, MealsRepository&gt;();
</code></pre>

<p>Add this line to the ConfigureServices Method</p>

<pre><code>services.AddSingleton(sp =&gt;
            sp.GetRequiredService&lt;IOptions&lt;DatabaseSettings&gt;&gt;().Value);
</code></pre>

<p><strong>appSettings.json</strong></p>

<p>Add these lines of code to this file</p>

<pre><code> "DatabaseSettings": {

    "ConnectionString": "your connection string to MongoDb"

}

</code></pre>

<p><strong>Database Settings.cs</strong></p>

<pre class="lang-cs prettyprint-override"><code>    public class DatabaseSettings
    {
        public string ConnectionString { get; set; } 
    }

</code></pre>

<p><strong>MealPlanModel.cs:</strong></p>

<pre class="lang-cs prettyprint-override"><code>using MongoDB.Bson;

using MongoDB.Bson.Serialization.Attributes;

public class MealPlanModel
{

    #region MealPlanModel fields
    [BsonElement("userid")]
    public int? UserId { get; set; }

    [BsonElement("mealid")]
    public int? MealId { get; set; }

    [BsonElement("mealname")]
