    }
}
</code></pre>

<p><strong>MealPlanDto.cs</strong></p>

<pre class="lang-cs prettyprint-override"><code>using MongoDB.Bson;

using MongoDB.Bson.Serialization.Attributes;

using System.Collections.Generic;

public class MealPlanDto

